/* read game stats */
function gameStreaks(array) {
  curstreak = 0;
  maxstreak = 0;
  count = 0;
  if (array.length == 1) {
    if (array[0] == "0") {
      return ["0", "0", "0"];
    } else {
      return ["1", "1", "1"];
    }
  } else {
    for (let i = 0; i < array.length - 1; i++) {
      if (array[i] == "1") {
        count++;
        curstreak++;
      } else {
        if (maxstreak < curstreak) {
          maxstreak = curstreak;
        }
        curstreak = 0;
      }
    }
    if (maxstreak < curstreak) {
      maxstreak = curstreak;
    }
    if (array[array.length - 1] == "1") {
      count++;
      curstreak++;
      if (maxstreak < curstreak) {
        maxstreak = curstreak;
      }
    }
  }
  return [String(count), String(curstreak), String(maxstreak)];
}


